  false,\n\t\"url\": null,\n\t\"notes\": \"An attempt was made to review all available
  data on the extent and status of riparian ecosystems in the U.S.A. This report presents
  a synthesis of the findings, including some estimates of how much land was originally
  covered byword riparian vegetation, and how much remains in that condition today.
  A synopsis of information is presented on the status of riparian ecosystems in each
  of 10 regions: California, Pacific Northwest, Rocky Mountain, Arid Southwest, Plains-Grasslands,
  Lake States, Corn Belt, Mississippi Delta, Northeast-Appalachian, and Southeast.\",\n\t\"license_title\":
